/*Table structure for table `answer_onlooker` */

DROP TABLE IF EXISTS `answer_onlooker`;

CREATE TABLE `answer_onlooker` (
  `answer_id` int(10) unsigned NOT NULL COMMENT '回答ID',
  `user_id` int(10) unsigned NOT NULL COMMENT '用户ID',
  `amount` int(10) unsigned NOT NULL COMMENT '围观金额',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`answer_id`,`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `answer_onlooker` */

/*Table structure for table `answers` */

DROP TABLE IF EXISTS `answers`;

CREATE TABLE `answers` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `question_id` int(10) unsigned NOT NULL COMMENT '所属问题',
  `user_id` int(10) unsigned NOT NULL COMMENT '用户',
  `body` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '回答内容',
  `anonymity` tinyint(3) unsigned DEFAULT 0 COMMENT '是否作者匿名',
  `adoption` tinyint(4) DEFAULT 0 COMMENT '是否被采纳',
  `invited` tinyint(4) DEFAULT 0 COMMENT '是否是被邀请回答',
  `comments_count` int(11) DEFAULT 0 COMMENT '问题评论统计',
  `rewards_amount` bigint(20) unsigned DEFAULT 0 COMMENT '打赏总额',
  `rewarder_count` int(10) unsigned DEFAULT 0 COMMENT '打赏的人统计',
  `likes_count` int(11) DEFAULT 0 COMMENT '喜欢数量统计',
  `views_count` int(10) unsigned DEFAULT 0 COMMENT '答案查看数量统计',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `text_body` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '纯文字回答内容',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `answers` */

/*Table structure for table `areas` */

DROP TABLE IF EXISTS `areas`;

CREATE TABLE `areas` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '名字',
  `pid` int(11) NOT NULL COMMENT '父级ID',
  `extends` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '扩展内容',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `areas_name_index` (`name`),
  KEY `areas_pid_index` (`pid`)
) ENGINE=MyISAM AUTO_INCREMENT=3221 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

