/*Table structure for table `wallet_charges` */

DROP TABLE IF EXISTS `wallet_charges`;

CREATE TABLE `wallet_charges` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned DEFAULT NULL COMMENT '关联用户，可不存在，例如直接支付方式等。存在便于按照用户检索。',
  `channel` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '支付频道，参考 Ping++，增加 user 选项，表示站内用户凭据',
  `account` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '交易账户，减项为目标账户，增项为来源账户，当 type 为 user 时，此处是用户ID',
  `charge_id` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '凭据id, 来自 Ping ++ ',
  `action` tinyint(3) unsigned NOT NULL COMMENT '类型：1 - 增加，0 - 减少',
  `amount` bigint(20) unsigned NOT NULL COMMENT '总额',
  `currency` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT 'cny' COMMENT '货币类型',
  `subject` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '订单标题',
  `body` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '订单详情',
  `transaction_no` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '平台记录ID',
  `status` tinyint(3) unsigned DEFAULT 0 COMMENT '状态：0 - 等待, 1 - 成功, 2 - 失败',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `wallet_charges_user_id_index` (`user_id`),
  KEY `wallet_charges_charge_id_index` (`charge_id`),
  KEY `wallet_charges_channel_index` (`channel`),
  KEY `wallet_charges_account_index` (`account`),
  KEY `wallet_charges_status_index` (`status`),
  KEY `wallet_charges_action_index` (`action`),
  KEY `wallet_charges_transaction_no_index` (`transaction_no`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `wallet_charges` */

/*Table structure for table `wallet_orders` */

DROP TABLE IF EXISTS `wallet_orders`;

CREATE TABLE `wallet_orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `owner_id` int(10) unsigned NOT NULL COMMENT '记录所属者',
  `target_type` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '目标类型',
  `target_id` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '目标标识',
  `title` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '订单标题',
  `body` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '详情',
  `type` tinyint(4) NOT NULL COMMENT '1：入账、-1：支出',
  `amount` int(10) unsigned NOT NULL COMMENT '订单金额',
  `state` tinyint(4) DEFAULT 0 COMMENT '订单状态，0: 等待，1：成功，-1: 失败',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `wallet_orders_owner_id_index` (`owner_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

